import React, { Component } from 'react'

export default class Roomdetaillist extends Component {
    render() {
        return (
            <>
                {
                  Object.keys(this.props.data.rooms).map(data=>(
                    <div className="dropdown">
                        <button className="dropbtn">{this.props.data.rooms[data].id}</button>
                        {
                            Object.keys(this.props.data.rooms[data].bedList).map(d=>(
                                <div className="dropdown-content">
                                        <a href="#">{this.props.data.rooms.bedList[d].bed_id}</a>                               
                               </div>
                            ))
                        }
                    </div>
                    ))  
                }
                {/* ============================================================================ */}
                {/* <div className="dropdown-content">
                        <a href="#">Bed 1</a>
                        <a href="#">Bed 2</a>
                        <a href="#">Bed 3</a>
                    </div> */}
                {/* =============================================================================== */}
                <div className="amini-block">
                    <label className="amini-container">Wifi
                        <input type="checkbox"  />
                            <span className="checkmark"></span>
                    </label>
                    <label className="amini-container">Zym
                        <input type="checkbox"  />
                            <span className="checkmark"></span>
                    </label>
                    <label className="amini-container">News Paper
                        <input type="checkbox"  />
                            <span className="checkmark"></span>
                    </label>
                    <label className="amini-container">Meals
                        <input type="checkbox" />
                            <span className="checkmark"></span>
                    </label>
                 </div>
            </>
        )
    }
}
